def shift_events_by_team
  events_by_team - goal_events
end

def events_by_team
  events
  .select { |event|
    event["teamId"] == @team.team_id
  }
end

def goal_events
  events_by_team.select { |event|
    event["typeCode"] == 505
  }
end
